import React, { Component } from 'react'

export default class Generate extends Component {
    render() {
        return (
            <div className="UserInput">
                <label>Title:</label>
                <input type="text"></input>
                <label>Description:</label>
                <input type="text"></input>
                <button>Generate</button>
            </div>
        )
    }
}
